INSERT INTO `recomendedletter` (`id_recomendedletter`, `created_date`, `id_user`, `letter_code`, `characteristic`, `degree`, `attachment`, `asfor`, `organization_id`, `terminate_id`, `employee_description`, `company_description`, `recomended_mediator`, `recomended_descriptio`, `status`, `letter_code_alliance`, `letter_date_alliance`) VALUES
(1, '2016-05-09 12:05:00', 2, '234', 1, 1, 1, 1, 8, 1, '<p style="text-align: justify;">Berdasarkan permasalahan yang terjadi di perusahaan PT. FENG TAY INDONESIA Enterprises ketika Pihak Pengusaha PT. FENG TAY INDONESIA ENTERPRISES menggangap bahwa pekerja / karyawan atas nama IYAN TARYANA NIK 0811261 Departemen E10 W1 Jabatan Operator di anggap telah bolos/ mangkir kerja 5 ( lima ) hari secara berturut-turut yaitu tanggal 27, 30 November 2015,&nbsp; tanggal 1,2,3,4 Desember 2015, sehingga yang bersangkutan dinyatakan mengundurkan diri sesuai dengan ketentuan sebagaimana diatur dalam Pasal 168 UU Nomor 13 tahun 2013 tentang Ketenagakerjaan dan kepada yang bersangkutan Pihak Pengusaha PT. FENGTAY INDONESIA ENTERPRISES akan memberikan kompensasi berdasarkan ketentuan sebagaimana diatur dalam Pasal 49 ayat 9 PKB yang ada di Perusahaan PT. FENG TAY INDONESIA ENTERPRISES, maka bersama ini kami paparkan kronologis permasalahan sesuai dengan fakta yang sebenarnya,&nbsp; sebagai berikut </p><ul style="text-align: justify;"><li>Bahwa pada tanggal 27 Nopember 2015 pekerja/ karyawan sebagaimana tersebut diatas mengajukan ijin secara lisan untuk tidak bekerja dikarenakan ada keperluan keluarga dan pada tanggal 30 November 2015 di karenakan Saudara yang bersangkutan meninggal di Garut melalui pekerja/karyawan PT. FENGTAY INDONESIA ENTERPRISES lainya yaitu        Sdr. YAYAN KOMARUDIN untuk disampaikan kepada pimpinan terkait dan oleh Sdr. YAYAN KOMARUDIN telah disampaikan pemberitahuan ijin tidak bekerja tersebut pada Ibu ROSAENI selaku Manager SO dan pada tanggal 01 Desember 2015 yang bersangkutan kembali tidak masuk kerja namun tidak memberitahukannya</li><li>Bahwa pada hari jumat tanggal 27 November 2015 Pihak Pengusaha PT. FENGTAY INDONESIA ENTERPRISES melayangkan surat panggilan kepada Sdr. IYAN TARYANA untuk menghadap kepada Personalia pada hari Senin tanggal 30 November 2015 namun yang bersangkutan tidak dapat memenuhi panggilan tersebut dikarenakan telah mengajukan ijin sebagaimana tersebut di atas.</li><li>Bahwa pada hari Selasa tanggal 01 Desember 2015 yang bersangkutan menerima kembali surat panggilan dari Pihak Pengusaha PT. FENGTAY INDONESIA ENTERPRISES untuk menghadap kepada Personalia pada hari Rabu tanggal 02 Desember 2015.</li><li>Bahwa pada hari Kamis tanggal 03 Desember 2015 yang bersangkutan didampingi oleh Ketua Basis GASPERMINDO PT. FENGTAY INDONESIA ENTERPRISES ( Sdr. DAMAN SURAHMAN ) menghadap kepada Manajer Personalia PT. FENGTAY INDONESIA ENTERPRISES  yaitu Ibu NINA GUSTIANA dan ketika itu Ibu NINA GUSTIANA mengatakan      bahwa Sdr. IYAN TARYANA di berikan 2 ( dua ) pilihan yaitu mengundurkan diri atau PHK  dan yang bersangkutan tidak mau mengundurkan diri disebabkan masih ingin kerja, dan ibu NINA GUSTIANA mengatakan bahwa Sdr. IYAN TARYANA tidak bisa bekerja lagi dikarenakan sudah ada pernyataan sebelumnya dari Sdr. IYAN TARYANA yang diminta oleh Pihak Pengusaha PT. FENGTAY INDONESIA ENTERPRISES ketika yang bersangkutan mendapatkan SP3 atas pelanggaran sebelumnya, setelah selesai kepentingan terkait dengan surat panggilan sebagaimana tersebut yang bersangkutan sudah tidak diijinkan untuk bekerja kembali oleh Ibu NINA GUSTINA.</li><li>Bahwa pada hari Senin tanggal 28 Desember 2015 Sdr. IYAN TARYANA menghadap kepada Ibu NINA GUSTINA untuk mengajukan agar dapat masuk bekerja seperti biasa namun Ibu NINA GUSTINA mangatakan sudah ada keputusan bahwa Sdr. IYAN TARYANA dianggap telah mangkir kerja selama 6 ( enam ) hari atau lebih berturut turut. </li></ul><div style="text-align: justify;"><br></div>', '<p style="text-align: justify;">Bahwa sesuai Undang-undang Nomor : 13 Tahun 2003 Pasal 168 yang bersangkutan dianggap mengundurkan diri karena&nbsp; 5 (lima) hari tidak masuk kerja tanpa alasan atau memberitahukan pada Perusahaan secara resmi, dan Perusahaan telah memanggil 2 ( dua ) kali secara resmi, panggilan kesatu dikeluarkan 30 Nopember 2015 untuk datang ke Perusahaan tanggal 1 Desember 2015 dan ybs tidak datang memenuhi panggilan tersebut. Panggilan kedua dikeluarkan tanggal 3 Desember 2015 untuk datang tanggal 4 Desember 2015, dan saat itu Ybs datang memenuhi panggilan Jam 08.30 wib. Tetapi ybs tetap tidak masuk kerja.&nbsp; ( terlihat sudah tidak ada itikad untuk kerja,&nbsp;&nbsp; sebagai bahan Informasi jam kerja ybs 07.30 ), maka kepadanya di nyatakan dianggap mengundurkan diri dari perusahaan.<br><br>Bahwa untuk diketahui selama ybs bekerja telah memiliki 14 surat peringatan, dan terbanyak adalah di Pelanggaran bolos kerja dengan 11 kali surat peringatan, (data surat SP terlampir) sehingga sebenarnya Perusahaan telah memberikan kesempatan kepada ybs untuk memperbaiki absensi tetapi yang bersangkutan tidak mengindahkannya.<br></p><p><br>Maka dengan Putusan tersebut kompensasi yang diberikan sesuai dengan UUTK Nomor : 13&nbsp; Tahun 2003 Pasal 168 ayat 3 atau PKB Perusahaan Pasal 49 ayat 9 yaitu : Pekerja&nbsp;&nbsp; dinyatakan / dianggap mengundurkan diri karena mangkir 5 hari atau lebih, setelah di panggil dua kali personalia dengan surat resmi tetapi tidak mengindahkanya, dan di berikan kompensasi sebesar 15% sesuai pasal 48 ayat 4 dan di berikan uang pisah sesuai ketentuan perusahaan ( Rp. 20.000.- ).<br><br></p>', '<ul><li>Bahwa Pekerja Sdr. IYAN TARYANA&nbsp; telah bekerja di Perusahaan PT. FENGTAY INDONESIA dengan masa kerja 7 tahun lebih ditempatkan Departemen E10 W1 Jabatan Operator dan diberikan Upah sebesar Rp. 2.132.250,-,- / bulan.</li><li>Bahwa Pihak Pekerja ( Sdr.&nbsp; IYAN TARYANA&nbsp; ) dianggap telah bolos/ mangkir kerja 5&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ( lima ) hari secara berturut-turut yaitu tanggal 27, 30 November 2015,&nbsp; tanggal 1,2,3,4 Desember 2015, sehingga yang bersangkutan dinyatakan mengundurkan diri sesuai dengan ketentuan sebagaimana diatur dalam Pasal 168 UU Nomor 13 tahun 2013 tentang Ketenagakerjaan dan kepada yang bersangkutan Pihak Pengusaha PT. FENGTAY INDONESIA ENTERPRISES akan memberikan kompensasi berdasarkan ketentuan sebagaimana diatur dalam Pasal 49 ayat 9 PKB yang ada di Perusahaan PT. FENGTAY INDONESIA ENTERPRISES, hal ini dapat dipertimbangkan.<br></li><li>Bahwa berkaitan ketidakhadiran Pihak Pekerja, Pihak Perusahaan&nbsp; telah memanggil&nbsp; 2 (dua) kali secara patut pada tanggal 27 November&nbsp; dan 01 Desember 2015 dan Pihak Pekerja&nbsp; menghadap&nbsp; pada hari Kamis tanggal 03 Desember 2015 dengan didampingi oleh Ketua Basis GASPERMINDO PT. FENGTAY INDONESIA ENTERPRISES ( Sdr. DAMAN SURAHMAN ) menghadap kepada Manajer Personalia&nbsp; dan dalam pertemuan tersebut Pihak Pekerja di berikan 2 ( dua ) pilihan yaitu mengundurkan diri atau PHK  dan Pihak Pekerja tidak mau mengundurkan diri disebabkan masih ingin kerja, dan Pihak Perusahaan mengatakan bahwa Sdr. IYAN TARYANA tidak bisa bekerja lagi dikarenakan sudah ada pernyataan sebelumnya tertanggal 8 Oktober 2015 dari Sdr. IYAN TARYANA yang diminta oleh Pihak Pengusaha&nbsp;&nbsp;&nbsp;&nbsp; PT. FENGTAY INDONESIA ENTERPRISES ketika yang bersangkutan mendapatkan SP3 atas pelanggaran sebelumnya, setelah selesai kepentingan terkait dengan surat panggilan sebagaimana tersebut yang bersangkutan sudah tidak diijinkan untuk bekerja kembali oleh Ibu NINA GUSTINA, hal ini dapat dipertimbangkan.<br></li><li>Bahwa pada hari Senin tanggal 28 Desember 2015 Pihak Pekerja ( Sdr. IYAN TARYANA ) menghadap kepada Pihak Perusahaan&nbsp; untuk mengajukan agar dapat masuk bekerja seperti biasa namun Pihak Perusahaan mangatakan sudah ada keputusan bahwa Pihak Pekerja&nbsp; (Sdr. IYAN TARYANA) dianggap telah mangkir kerja selama 6 ( enam ) hari atau lebih berturut turut. <br></li><li>Bahwa&nbsp; dalam Sidang Mediasi di Dinas Tenaga Kerja Kabupaten Bandung Pihak Perusahaan menyatakan bahwa Pihak Pekerja telah memiliki 14 Surat Peringatan dan terbanyak adalah pelangggaran bolos kerja dengan 11 kali Surat Peringatan, pada dasarnya Pihak perusahaan telah memberikan kesempatan kepada Pihak Pekerja ( Sdr. IYAN TARYANA )&nbsp; untuk memperbaiki Absensi tetapi&nbsp; Pihak Pekerja tidak mengindahkannya, hal ini tidak dapat dipertimbangkan.<br></li><li>Bahwa dalam Pertemuan sidang mediasi Pihak Pekerja&nbsp; tetap menuntut Uang pesangon sebesar 1 (Satu) kali ketentuan Undang-undang Nomor : 13 Tahun 2003, sedangkan Pihak Perusahaan tetap menganggap Pekerja mengundurkan diri sesuai PKB Pasal 49 ayat (9) dan Undang-undang Nomor : 13 Tahun 2003 Pasal 156 ayat (4), hal ini dapat dipertimbangkan.<br></li><li>Bahwa setelah dipertemukan secara Tripartit di Dinas Tenaga Kerja Kabupaten Bandung Kedua belah&nbsp; pihak masih tetap pada pendiriannya masing-masing sehingga tidak ada titik temu. <br></li><li>Bahwa sesuai dengan ketentuan Perundang-undangan&nbsp; untuk menyelesaikan Perselisihan Pemutusan Hubungan Kerja tersebut Mediator Dinas Tenaga Kerja Kabupaten Bandung<br></li></ul>', '<ol><li>Hubungan Kerja antara Pekerja ( Sdr. IYAN TARYANA ) dengan Perusahaan                ( PT. FENGTAY INDONESIA )  Putus terhitung sejak Tanggal  5  Desember   2015.</li><li>&nbsp;Agar Pihak Perusahaan  ( PT. FENGTAY INDONESIA ) memberikan Penggantian Hak dan  Uang Pisah sesuai dengan Perjanjian Kerja Bersama Pasal 51  ayat  (3)  kepada Pihak Pekerja ( Sdr. IYAN TARYANA ) adapun  perhitungannya sebagai berikut :</li></ol>', 0, '047/DEPENCAB-GPM/KAB-BDG/I/2016', '2016-05-09');
